fmt::Debugはコンパクトでクリーンであるようには見えませんね。大抵の場合は、アウトプットの見た目をカスタマイズしたほうが好ましいでしょう。これは{}を使用する fmt::Display を手動で実装することで可能です。実装はこのようになります。 // （`use`を使用し、）`fmt`モジュールをインポートします。
use std::fmt; // `fmt::Display`を実装するための構造体を定義します。
// これは`Structure`と名付けられた、`i32`を含むタプル構造体です。
struct Structure(i32); // `{}` というマーカーを使用するためには、
// この型専用の`fmt::Display`というトレイトが実装されていなくてはなりません。
impl fmt::Display for Structure { // このトレイトは`fmt`が正確にこの通りのシグネチャであることを要求します。 fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { // 最初の要素だけを、与えられた出力ストリーム`f`に書き込みます。 // 操作が成功したかどうかを表す`fmt::Result`を返します。 // `write!`は`println!`に非常によく似た文法を使用していることに注目。 write!(f, "{}", self.0) }
} fmt::Displayはfmt::Debugより綺麗かもしれませんが、stdライブラリの場合は問題が生じます。曖昧な型はどのように表示すれば良いでしょう？例えば、stdライブラリがあらゆるVec<T>に対して単一のスタイルを提供していた場合、どのようなスタイルに整形すればよいでしょう？以下の2つのどちらかを選ぶべきでしょうか？ Vec<path>: /:/etc:/home/username:/bin （:で分割） Vec<number>: 1,2,3 （,で分割） 答えはNOです。あらゆる型に対して理想的なスタイルなどというものはありませんし、stdライブラリによってそれが提供されているわけでもありません。fmt::DisplayはVec<T>のようなジェネリックなコンテナ用に定義されているわけではありませんので、このような場合はfmt::Debugを使用するべきです。 ジェネリック でない コンテナ型の場合は、このような問題は生じませんので問題なくfmt::Displayを実装することができます。 use std::fmt; // `fmt`のインポート // 2つの数字を扱うための構造体です。出力を`Display`と比較するため`Debug`
// を導出しています。
#[derive(Debug)]
struct MinMax(i64, i64); // `MinMax`用の`Display`を実装しています。
impl fmt::Display for MinMax { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { // `self.number`でそれぞれのデータポイントを参照できます。 write!(f, "({}, {})", self.0, self.1) }
} // 比較のため、フィールドに名前をつけられる様な構造体を定義しましょう。
#[derive(Debug)]
struct Point2D { x: f64, y: f64,
} // 先程と同様にして、`Point2D`用の`Display`を実装しています。
impl fmt::Display for Point2D { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { // `x`と`y`のみが明示的になるようにカスタマイズ。 write!(f, "x: {}, y: {}", self.x, self.y) }
} fn main() { let minmax = MinMax(0, 14); println!("Compare structures:"); println!("Display: {}", minmax); println!("Debug: {:?}", minmax); let big_range = MinMax(-300, 300); let small_range = MinMax(-3, 3); println!("The big range is {big} and the small is {small}", small = small_range, big = big_range); let point = Point2D { x: 3.3, y: 7.2 }; println!("Compare points:"); println!("Display: {}", point); println!("Debug: {:?}", point); // `Debug`と`Display`は実装されていますが、`fmt::Binary`はされていないため // `{:b}`使用している以下の例はエラーになります。 // println!("What does Point2D look like in binary: {:b}?", point);
} fmt::Displayは実装されていますが、fmt::Binaryはされていないので使用できません。std::fmtにはそのような トレイト が数多くあり、それぞれに独自の実装が必要です。詳しくは std::fmt を参照してください。

100.body:
Rustはたいていの場合、型アノテーションなしでも変数を捕捉する方法を臨機応変に選択してくれますが、関数を書く場合にはこの曖昧さは許されません。引数のパラメータとしてクロージャを取る場合、そのクロージャの完全な型はいくつかのtraitsの中の1つを使って明示されなければなりません。どれが使われるかは、捕捉された値でクロージャが何をするかによって決まります。制限の少ない順に並べると、下記の通りです。 Fn：参照（&T）によって捕捉するクロージャ FnMut：ミュータブルな参照（&mut T）によって捕捉するクロージャ FnOnce：値（T）によって捕捉するクロージャ 変数ごとに、コンパイラは可能な限り制約の少ない方法でその変数を捕捉します。 例えば、FnOnceというアノテーションの付けられたパラメータを考えてみましょう。これはそのクロージャが&T、&mut TもしくはTの どれか で捕捉することを指定するものですが、コンパイラは捕捉した変数がそのクロージャの中でどのように使用されるかに基づき、最終的に捕捉する方法を選択することになります。 これは、もし移動が可能であれば、いずれの種類の借用であっても同様に可能だからです。その逆は正しくないことに注意してください。パラメータがFnとしてアノテーションされている場合、変数を&mut TやTで捕捉することは許可されません。しかし&Tは許可されます。 以下の例で、Fn、FnMut、およびFnOnceを入れ替えて、何が起こるのかを見てみましょう。 // クロージャを引数として取り、クロージャを呼び出す関数。
// <F>はFが「ジェネリックな型パラメータ」であることを示します。
fn apply<F>(f: F) where // クロージャには引数も返り値もありません。 F: FnOnce() { // ^ TODO: ここを`Fn`あるいは`FnMut`に変えてみましょう。 f();
} // クロージャを引数に取り、`i32`を返す関数
fn apply_to_3<F>(f: F) -> i32 where // このクロージャは引数、返り値ともに`i32`。 F: Fn(i32) -> i32 { f(3)
} fn main() { use std::mem; let greeting = "hello"; // コピーではなくmoveが起きる型 let mut farewell = "goodbye".to_owned(); // 変数を2つ捕捉。`greeting`は参照を、 // `farewell`は値をそれぞれ捕捉します。 let diary = || { // `greeting`は参照なので、`Fn`が必要です。 println!("I said {}.", greeting); // `farewell`の値を変更するので、この時点で`FnMut` // が必要になります。 farewell.push_str("!!!"); println!("Then I screamed {}.", farewell); println!("Now I can sleep. zzzzz"); // `mem::drop`を明示的に呼ぶと`farewell`が値で // 捕捉される必要性が発生します。よって`FnOnce`が必要になります。 mem::drop(farewell); }; // クロージャを適用する関数を実行。 apply(diary); // `double`は`apply_to_3`のトレイト境界を満たす。 let double = |x| 2 * x; println!("3 doubled: {}", apply_to_3(double));
}

102.body:
クロージャが周辺の環境から変数を取得するやり方は非常に明瞭です。何か注意すべき点はあるのでしょうか？もちろんです。関数内でクロージャを使う場合、 ジェネリクス を使用する必要があります。詳しく見ていきましょう。 // `F` はジェネリック型でなくてはなりません。
fn apply<F>(f: F) where F: FnOnce() { f();
} クロージャが定義されると、コンパイラは裏側で、無名の構造体を作り、そこにクロージャによって使用される外側の変数を入れます。同時にFn、FnMut、FnOnceという名のトレイトのいずれか一つを介してこの構造体に関数としての機能を実装し、実際に呼び出されるまで待ちます。 この無名構造体は型が未指定なため、関数を実行する際にはジェネリクスが必要とされます。とはいえ、<T>で指定するだけでは、まだ曖昧です。（訳注：&self、&mut self、selfのいずれをとるのかがわからないため）そのため、Fn、FnMut、FnOnceのいずれか一つを実装することで対応しています。 // `F`は引数と戻り値を持たないクロージャ`Fn`を実装していなくてはなりません。
// これはまさに`print`に必要とされるものです。
fn apply<F>(f: F) where F: Fn() { f();
} fn main() { let x = 7; // `x`を無名の構造体に入れ、それに対し`Fn`を実装します。 // （訳注: ここでは`Fn`は`fn Fn(&self) -> {println!("{}", &self)}`） // その構造体を`print`に代入します。 let print = || println!("{}", x); apply(print);
}

