Iterator::find is a function which iterates over an iterator and searches for the first value which satisfies some condition. If none of the values satisfy the condition, it returns None. Its signature: pub trait Iterator { // イテレートされる値の型 type Item; // `find`は`&mut self`を取るため、イテレータを呼び出した値を借用し // 変更しますが、消費することはありません。 fn find<P>(&mut self, predicate: P) -> Option<Self::Item> where // `FnMut`はクロージャによって捕捉される変数が変更される // 事はあっても消費されることはないということを示します。 // `&Self::Item`はクロージャが変数を参照として取ることを示します。 P: FnMut(&Self::Item) -> bool;
} fn main() { let vec1 = vec![1, 2, 3]; let vec2 = vec![4, 5, 6]; // ベクタ型に対する`iter`は`&i32`を生成します。 let mut iter = vec1.iter(); // `inter_iter()`の場合は`i32`を生成します。 let mut into_iter = vec2.into_iter(); // `iter()`は`&i32`を生成し、ここではその参照が必要なので // `&&i32`を`i32`へとデストラクトします。 println!("Find 2 in vec1: {:?}", iter .find(|&&x| x == 2)); // `into_iter()`は`i32`を生成し、ここではその参照が必要なので // `&i32`を`i32`へとデストラクトします。 println!("Find 2 in vec2: {:?}", into_iter.find(| &x| x == 2)); let array1 = [1, 2, 3]; let array2 = [4, 5, 6]; // 配列に対する`iter()`も`&i32`を生成します。 println!("Find 2 in array1: {:?}", array1.iter() .find(|&&x| x == 2)); // 配列に`into_iter()`を使うと`&i32`を生成します。 println!("Find 2 in array2: {:?}", array2.into_iter().find(|&x| x == 2));
} Iterator::findは要素への参照を返します。要素の インデックス を使用したい場合、Iterator::positionを使用してください。 fn main() { let vec = vec![1, 9, 3, 3, 13, 2]; // `iter()`は`&i32`を生成しますが`position()`は参照を取らないので // `&i32`を`i32`へとデストラクトします。 let index_of_first_even_number = vec.iter().position(|&x| x % 2 == 0); assert_eq!(index_of_first_even_number, Some(5)); // `into_iter()`は`i32`を生成し、`position()`は参照を取らないので // `デストラクトする必要はありません。 let index_of_first_negative_number = vec.into_iter().position(|x| x < 0); assert_eq!(index_of_first_negative_number, None);
}

113.body:
Rustには高階関数（Higher Order Functions, HOF）を扱う機能が備わっています。 fn is_odd(n: u32) -> bool { n % 2 == 1
} fn main() { println!("Find the sum of all the numbers with odd squares under 1000"); let upper = 1000; // 宣言型プログラミングによるアプローチ // 値を蓄積する変数を宣言。 let mut acc = 0; // 0から無限までイテレートします。 for n in 0.. { // 値を2乗。 let n_squared = n * n; if n_squared >= upper { // 上限に達した場合、ループを終了。 break; } else if is_odd(n_squared) { // 奇数ならば値を値を足しあわせていきます。 acc += n_squared; } } println!("imperative style: {}", acc); // 関数型プログラミングによるアプローチ let sum_of_squared_odd_numbers: u32 = (0..).map(|n| n * n) // 全自然数を2乗し .take_while(|&n_squared| n_squared < upper) // 上限より小さい値で .filter(|&n_squared| is_odd(n_squared)) // かつ奇数のものを .sum(); // 合計します。 println!("functional style: {}", sum_of_squared_odd_numbers);
} Option と イテレータ には高階関数が使用されています。

114.body:
発散する関数は決してリターンしない関数です。こうした関数は ! を使って、空の型であることが示されます。 fn foo() -> ! { panic!("This call never returns.");
} 他の全ての型と異なり、この型はインスタンス化できません。この型が持ちうる全ての値の集合は空です。この型は()型とは異なることに注意してください。()型は値をただ1つだけ持つ型です。 例えば、この関数は通常どおりリターンしますが、戻り値には何の情報も含みません。 fn some_fn() { ()
} fn main() { let _a: () = some_fn(); println!("This function returns and you can see this line.");
} 一方、この関数は呼び出し元に決してリターンしません。 #![feature(never_type)] fn main() { let x: ! = panic!("This call never returns."); println!("You will never see this line!");
} これは抽象的な概念に見えるかもしれませんが、実際のところはとても実用的で、便利なことも多いのです。この型の主な利点は、他のどのような型にもキャストできることです。そのため、例えばmatchの分岐の中のような正確な型が要求される場所でも使用できます。 fn main() { fn sum_odd_numbers(up_to: u32) -> u32 { let mut acc = 0; for i in 0..up_to { // 変数"addition"の型がu32であるため、 // このmatch式はu32をリターンしなければならないことに注意。 let addition: u32 = match i%2 == 1 { // 変数"i"はu32型であるため、全く問題ありません。 true => i, // 一方、"continue"式はu32をリターンしませんが、これでも問題ありません。 // 決してリターンしないため、このmatch式が要求する型に違反しないからです。 false => continue, }; acc += addition; } acc } println!("Sum of odd numbers up to 9 (excluding): {}", sum_odd_numbers(9));
} この型は、ネットワークサーバのような永遠にループする関数（例：loop {}）の戻り値の型や、プロセスを終了させる関数（例：exit()）の戻り値の型としても使用されます。

116.body:
デフォルトでは、モジュール内の要素はプライベートですが、これはpubで修飾することでパブリックな属性にすることができます。パブリックな属性のみがモジュールの外のスコープからアクセスできます。 // `my_mod`という名前のモジュール
mod my_mod { // モジュール内の要素はデフォルトでプライベート。 fn private_function() { println!("called `my_mod::private_function()`"); } // `pub`を用いてパブリックに変更。 pub fn function() { println!("called `my_mod::function()`"); } // モジュール内からならば、プライベートな属性にアクセスできます。 pub fn indirect_access() { print!("called `my_mod::indirect_access()`, that\n> "); private_function(); } // モジュールもネストできます。 pub mod nested { pub fn function() { println!("called `my_mod::nested::function()`"); } #[allow(dead_code)] fn private_function() { println!("called `my_mod::nested::private_function()`"); } // `pub(in path)`形式で宣言された関数は該当のパス内でのみアクセスできます。 // `path`は親や先祖のモジュールでなくてはなりません。 pub(in crate::my_mod) fn public_function_in_my_mod() { print!("called `my_mod::nested::public_function_in_my_mod()`, that\n> "); public_function_in_nested(); } // `pub(self)`形式で宣言された関数は現在のモジュール内でのみアクセスできます。 // つまり、プライベートにするのと同じです。 pub(self) fn public_function_in_nested() { println!("called `my_mod::nested::public_function_in_nested()`"); } // `pub(super)`形式で宣言された関数は親モジュール内でのみアクセスできます。 pub(super) fn public_function_in_super_mod() { println!("called `my_mod::nested::public_function_in_super_mod()`"); } } pub fn call_public_function_in_my_mod() { print!("called `my_mod::call_public_function_in_my_mod()`, that\n> "); nested::public_function_in_my_mod(); print!("> "); nested::public_function_in_super_mod(); } // pub(crate)により関数は現在のクレート内でのみアクセスできます。 pub(crate) fn public_function_in_crate() { println!("called `my_mod::public_function_in_crate()`"); } // ネストしたモジュールも、同様の性質を示します。 mod private_nested { #[allow(dead_code)] pub fn function() { println!("called `my_mod::private_nested::function()`"); } // 親がプライベートな場合、子要素がより大きなスコープでアクセスできるように宣言されていても、 // 子要素にアクセス可能な範囲は制限されます。 #[allow(dead_code)] pub(crate) fn restricted_function() { println!("called `my_mod::private_nested::restricted_function()`"); } }
} fn function() { println!("called `function()`");
