struct Cow {} trait Animal { // インスタンスメソッドのシグネチャ fn noise(&self) -> &'static str;
} // `Animal`というトレイトを`Sheep`に実装します。
impl Animal for Sheep { fn noise(&self) -> &'static str { "baaaaah!" }
} // `Cow`に`Animal`トレイトを実装します。
