} impl fmt::Display for DoubleError { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { match *self { DoubleError::EmptyVec => write!(f, "please use a vector with at least one element"), // ラップされたエラーは追加情報を含み、 // source メソッドから取り出すことができます。 DoubleError::Parse(..) => write!(f, "the provided string could not be parsed as int"), } }
} impl error::Error for DoubleError { fn source(&self) -> Option<&(dyn error::Error + 'static)> { match *self { DoubleError::EmptyVec => None, // 元の実装のエラー型が原因。 // `&error::Error`トレイトオブジェクトに暗にキャストされます。 // 元となる型が`Error`トレイトをすでに実装しているため問題ありません。 DoubleError::Parse(ref e) => Some(e), } }
