Any type that implements the Eq and Hash traits can be a key in HashMap. This includes: bool （キーになりうる値が2つしかないので実用的ではないですが…） int、uint、あるいは他の整数型 Stringと&str（Tips：Stringをキーにしたハッシュマップを作製した場合、.get()メソッドの引数に&strを与えて値を取得することができます。） f32とf64はHashを実装して いない ことに注意しましょう。おそらくこれは 浮動小数点演算時に誤差が発生する ため、キーとして使用すると、恐ろしいほどエラーの元となるためです。 All collection classes implement Eq and Hash if their contained type also respectively implements Eq and Hash. For example, Vec<T> will implement Hash if T implements Hash. You can easily implement Eq and Hash for a custom type with just one line: #[derive(PartialEq, Eq, Hash)] The compiler will do the rest. If you want more control over the details, you can implement Eq and/or Hash yourself. This guide will not cover the specifics of implementing Hash. To play around with using a struct in HashMap, let's try making a very simple user logon system: use std::collections::HashMap; // Eqトレイトを使用する時は、PartialEqをderiveする必要があります。
