RustはCのライブラリを呼び出すために他言語関数インターフェイス（Foreign Function Interface, FFI）を持っています。他言語の関数を使用する際には、そのライブラリ名を#[link]アトリビュートに渡し、更にそれでアノテーションされたexternブロック内で宣言する必要があります。 use std::fmt; // このexternブロックはlibmライブラリをリンクします。
#[cfg(target_family = "windows")]
#[link(name = "msvcrt")]
extern { // 他言語の関数宣言。 // この関数は単精度浮動小数の複素数型の平方根を計算するためのものです。 fn csqrtf(z: Complex) -> Complex; fn ccosf(z: Complex) -> Complex;
}
#[cfg(target_family = "unix")]
#[link(name = "m")]
extern { // 他言語の関数宣言。 // この関数は単精度浮動小数の複素数型の平方根を計算するためのものです。 fn csqrtf(z: Complex) -> Complex; fn ccosf(z: Complex) -> Complex;
} // 型安全にするためのラッパ
fn cos(z: Complex) -> Complex { unsafe { ccosf(z) }
} fn main() { // z = -1 + 0i let z = Complex { re: -1., im: 0. }; // calling a foreign function is an unsafe operation let z_sqrt = unsafe { csqrtf(z) }; println!("the square root of {:?} is {:?}", z, z_sqrt); // calling safe API wrapped around unsafe operation println!("cos({:?}) = {:?}", z, cos(z));
} // 単精度浮動小数の複素数型の最小限の実装
#[repr(C)]
#[derive(Clone, Copy)]
struct Complex { re: f32, im: f32,
} impl fmt::Debug for Complex { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { if self.im < 0. { write!(f, "{}-{}i", self.re, -self.im) } else { write!(f, "{}+{}i", self.re, self.im) } }
}

