何もしない命令を挿入しても面白くありません。実際にデータを操作してみましょう。 # #[cfg(target_arch = "x86_64")] {
use std::arch::asm; let x: u64;
unsafe { asm!("mov {}, 5", out(reg) x);
}
assert_eq!(x, 5);
# } これはu64型の変数xに5の値を書き込んでいます。命令を指定するために利用している文字列リテラルが、実はテンプレート文字列になっています。これはRustの フォーマット文字列 と同じルールに従います。ですが、テンプレートに挿入される引数は、みなさんがよく知っているものとは少し違っています。まず、変数がインラインアセンブリの入力なのか出力なのかを指定する必要があります。上記の例では出力となっています。outと書くことで出力であると宣言しています。また、アセンブリが変数をどの種類のレジスタに格納するかについても指定する必要があります。上の例では、regを指定して任意の汎用レジスタに格納しています。コンパイラはテンプレートに挿入する適切なレジスタを選び、インラインアセンブリの実行終了後、そのレジスタから変数を読みこみます。 入力を利用する別の例を見てみましょう。 # #[cfg(target_arch = "x86_64")] {
use std::arch::asm; let i: u64 = 3;
let o: u64;
unsafe { asm!( "mov {0}, {1}", "add {0}, 5", out(reg) o, in(reg) i, );
}
assert_eq!(o, 8);
# } この例では、変数iの入力に5を加え、その結果を変数oに書き込んでいます。このアセンブリ特有のやり方として、はじめにiの値を出力にコピーし、それから5を加えています。 この例はいくつかのことを示します。 まず、asm!では複数のテンプレート文字列を引数として利用できます。それぞれの文字列は、改行を挟んで結合されたのと同じように、独立したアセンブリコードとして扱われます。このおかげで、アセンブリコードを容易にフォーマットできます。 つぎに、入力はoutではなくinと書くことで宣言されています。 そして、他のフォーマット文字列と同じように引数を番号や名前で指定できます。インラインアセンブリのテンプレートでは、引数が2回以上利用されることが多いため、これは特に便利です。より複雑なインラインアセンブリを書く場合、この機能を使うのが推奨されます。可読性が向上し、引数の順序を変えることなく命令を並べ替えることができるからです。 上記の例をさらに改善して、mov命令をやめることもできます。 # #[cfg(target_arch = "x86_64")] {
use std::arch::asm; let mut x: u64 = 3;
unsafe { asm!("add {0}, 5", inout(reg) x);
}
assert_eq!(x, 8);
# } inoutで入力でもあり出力でもある引数を指定しています。こうすることで、入力と出力を個別に指定する場合と違って、入出力が同じレジスタに割り当てられることが保証されます。 inoutのオペランドとして、入力と出力それぞれに異なる変数を指定することも可能です。 # #[cfg(target_arch = "x86_64")] {
use std::arch::asm; let x: u64 = 3;
let y: u64;
unsafe { asm!("add {0}, 5", inout(reg) x => y);
}
assert_eq!(y, 8);
# }

