多くの場合、インラインアセンブリは出力として必要のない状態を変更することがあります。これは普通、アセンブリでスクラッチレジスタを利用する必要があったり、私たちがこれ以上必要としていない状態を命令が変更したりするためです。この状態を一般的に"クロバー"（訳注：上書き）と呼びます。私たちはコンパイラにこのことを伝える必要があります。なぜならコンパイラは、インラインアセンブリブロックの前後で、この状態を保存して復元しなくてはならない可能性があるからです。 use std::arch::asm; # #[cfg(target_arch = "x86_64")]
fn main() { // 4バイトのエントリー3つ let mut name_buf = [0_u8; 12]; // 文字列はasciiとしてebx, edx, ecxの順に保存されています。 // ebxは予約されているので、アセンブリはebxの値を維持する必要があります。 // 従ってメインのアセンブリの前後でプッシュおよびポップを行います。 // （以下は64ビットプロセッサの64ビットモードの場合。32ビットプロセッサはebxを利用します。） unsafe { asm!( "push rbx", "cpuid", "mov [rdi], ebx", "mov [rdi + 4], edx", "mov [rdi + 8], ecx", "pop rbx", // いくつかのアセンブリ命令を追加してRustのコードを単純化するために // 値を格納する配列へのポインタを利用します。 // しかし、`out("ecx") val`のような明示的なレジスタの出力とは違い、 // アセンブリの動作をより明示的にします。 // *ポインタそのもの* は後ろに書かれていても入力にすぎません。 in("rdi") name_buf.as_mut_ptr(), // cpuid 0を選択し、eaxをクロバーに指定します。 inout("eax") 0 => _, // cpuidは以下のレジスタもクロバーします。 out("ecx") _, out("edx") _, ); } let name = core::str::from_utf8(&name_buf).unwrap(); println!("CPU Manufacturer ID: {}", name);
} # #[cfg(not(target_arch = "x86_64"))]
# fn main() {} 上の例では、cpuid命令を使い、CPUベンタIDを読み込んでいます。この命令はeaxにサポートされている最大のcpuid引数を書き込み、ebx、edx、ecxの順にCPUベンダIDをASCIIコードとして書き込みます。 eaxは読み込まれることはありません。しかし、コンパイラがアセンブリ以前にこれらのレジスタにあった値を保存できるように、レジスタが変更されたことをコンパイラに伝える必要があります。そのために、変数名の代わりに_を用いて出力を宣言し、出力の値が破棄されるということを示しています。 このコードはebxがLLVMによって予約されたレジスタであるという制約を回避しています。LLVMは、自身がレジスタを完全にコントロールし、アセンブリブロックを抜ける前に元の状態を復元しなくてはならないと考えています。そのため、コンパイラがin(reg)のような汎用レジスタクラスを満たすために使用する場合 を除いて ebxを入力や出力として利用できません。つまり、予約されたレジスタを利用する場合に、regオペランドは危険なのです。入力と出力が同じレジスタを共有しているので、知らないうちに入力や出力を破壊してしまうかもしれません。 これを回避するために、rdiを用いて出力の配列へのポインタを保管し、pushでebxを保存し、アセンブリブロック内でebxから読み込んで配列に書き込み、popでebxを元の状態に戻しています。pushとpopは完全な64ビットのrbxレジスタを使って、レジスタ全体を確実に保存しています。32ビットの場合、pushとpopにおいてebxがかわりに利用されるでしょう。 アセンブリコード内部で利用するスクラッチレジスタを獲得するために、汎用レジスタクラスとともに使用することもできます。 # #[cfg(target_arch = "x86_64")] {
use std::arch::asm; // シフト演算と加算を利用してxに6をかけます。
let mut x: u64 = 4;
unsafe { asm!( "mov {tmp}, {x}", "shl {tmp}, 1", "shl {x}, 2", "add {x}, {tmp}", x = inout(reg) x, tmp = out(reg) _, );
}
assert_eq!(x, 4 * 6);
# }

