use std::arch::asm; extern "C" fn foo(arg: i32) -> i32 { println!("arg = {}", arg); arg * 2
} fn call_foo(arg: i32) -> i32 { unsafe { let result; asm!( "call {}", // 呼び出す関数ポインタ in(reg) foo, // 最初の引数はrdiにあります。 in("rdi") arg, // 戻り値はraxにあります。 out("rax") result, // "C"の呼び出し規約で保存されていないすべてのレジスタをクロバーに指定。 clobber_abi("C"), ); result }
}
