Rustは多くのプログラミング言語と同様に、「キーワード」の概念を持っています。これらの識別子は言語にとって何かしらの意味を持ちますので、変数名や関数名、その他の場所で使用することはできません。生識別子は、通常は許されない状況でキーワードを使用することを可能にします。これは、新しいキーワードを導入したRustと、古いエディションのRustを使用したライブラリが同じ名前の変数や関数を持つ場合に特に便利です。 例えば、2015年エディションのRustでコンパイルされたクレートfooがtryという名前の関数をエクスポートしているとします。このキーワードは2018年エディションで新機能として予約されていますので、生識別子がなければ、この関数を名付ける方法がありません。 extern crate foo; fn main() { foo::try();
} このエラーが出ます： error: expected identifier, found keyword `try` --> src/main.rs:4:4 |
4 | foo::try(); | ^^^ expected identifier, found keyword これは生識別子を使って書くことができます： extern crate foo; fn main() { foo::r#try();
}

