pub struct Person { /// ジュリエットがどんなに名前というものを嫌っていようと、 /// 人物には名前が必要です。 name: String,
} impl Person { /// 与えられた名前を持つpersonを返します。 /// /// # Examples /// /// ``` /// // バッククォートによってRustのコードをコメント中に挟むこと /// // もできます。`rustdoc`に--testを渡せば、テストも行えます！ /// // （訳注: pythonのdoctestと同じです。） /// use doc::Person; /// let person = Person::new("name"); /// ``` pub fn new(name: &str) -> Person { Person { name: name.to_string(), } } /// フレンドリーに挨拶しましょう！ /// /// このメソッドを呼び出した`Person`に対して /// "Hello, [name](Person::name)"と話しかけます。 pub fn hello(&self) { println!("Hello, {}!", self.name); }
} fn main() { let john = Person::new("John"); john.hello();
} To run the tests, first build the code as a library, then tell rustdoc where to find the library so it can link it into each doctest program: $ rustc doc.rs --crate-type lib
$ rustdoc --test --extern doc="libdoc.rlib" doc.rs

