関数はfnキーワードを用いて定義することができます。引数は変数と同様に型を指定する必要があり、もし関数が値を返すならば->の後にその型も指定する必要があります。 関数内の最後の式が返り値となります。関数の途中で値を返したい場合はreturn文を使用します。ループの最中やif文の中からも値を返すことができます。 では、今度は関数を使ってFizzBuzz問題を解いてみましょう！ // C/C++とは違い、関数の定義を行う順番に制限はありません。
