} // ブーリアン型を返す関数
fn is_divisible_by(lhs: u32, rhs: u32) -> bool { // 例外的な引数を受けた場合、早めに返します。 if rhs == 0 { return false; } // これは式であり、`return`キーワードは必要ありません。 lhs % rhs == 0
} // 値を「返さない」関数、実際にはユニット型（`()`）を返しています。
